const remoteURL = "http://localhost:5002/"

export default  {
    getAllUsers() {
        return fetch (`${remoteURL}/users`).then(r=>r.json())

    },

    postUser(newUser) {
        return fetch (`${remoteURL}/users`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(newUser)
        }).then(r => r.json())
    }

}
